import React from "react";
import Header from "../component/Header";

function Contacts() {
  return (
    <>
      <Header />

      <section>
        <div className="container">
          <div className="work-sect text-center text-white">
            <h3>Let's Talk</h3>
          </div>
      
        </div>
      </section>
    </>
  );
}

export default Contacts;
